import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import authService from "../../services/authService";
import userService from "../../services/userService";

const Login = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    email: "",
    password: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

 const handleSubmit = async (e) => {
  e.preventDefault();
  try {
    const res = await authService.login(form);
    console.log("‚úÖ LOGIN RESULT:", res.data);

    const loginData = res.data;

    // ‚úÖ DEBUG CHI TI·∫æT C·∫§U TR√öC D·ªÆ LI·ªÜU
    console.log("üîç DEBUG LOGIN DATA STRUCTURE:", JSON.stringify(loginData, null, 2));

    let userToStore = null;
    let actualUserId = null;

    // ‚úÖ L∆ØU TOKEN TR∆Ø·ªöC (ƒë·ªÉ c√°c API sau c√≥ th·ªÉ d√πng)
    if (loginData.token) {
      localStorage.setItem("token", loginData.token);
      console.log("üîê Token saved:", loginData.token);
    }

    // ‚úÖ TR∆Ø·ªúNG H·ª¢P 1: N·∫øu c√≥ user_id/userId t·ª´ login response
    if (loginData.user_id || loginData.userId) {
      actualUserId = loginData.user_id || loginData.userId;
      console.log("üîë Found user ID from login:", actualUserId);
    }
    // ‚úÖ TR∆Ø·ªúNG H·ª¢P 2: N·∫øu c√≥ user object
    else if (loginData.user && (loginData.user.user_id || loginData.user.userId)) {
      actualUserId = loginData.user.user_id || loginData.user.userId;
      console.log("üîë Found user ID from user object:", actualUserId);
    }

    // ‚úÖ QUAN TR·ªåNG: N·∫øu kh√¥ng c√≥ user ID t·ª´ login response, T√åM USER B·∫∞NG EMAIL (V·ªöI TOKEN)
    if (!actualUserId) {
      console.log("üîÑ No user ID in login response, finding user by email:", form.email);
      try {
        const userByEmail = await userService.getUserByEmail(form.email);
        console.log("‚úÖ User found by email:", userByEmail);

        actualUserId = userByEmail.user_id || userByEmail.userId;
        console.log("üîë User ID found by email:", actualUserId);

      } catch (emailError) {
        console.error("‚ùå Error finding user by email:", emailError);
        // Kh√¥ng throw error ·ªü ƒë√¢y, ti·∫øp t·ª•c v·ªõi gi·∫£i ph√°p kh√°c
      }
    }

    // ‚úÖ N·∫æU C√ì USER ID: L·∫§Y TH√îNG TIN USER ƒê·∫¶Y ƒê·ª¶
    if (actualUserId) {
      try {
        console.log("üîÑ Fetching user profile for ID:", actualUserId);
        const userProfile = await userService.getUserProfile(actualUserId);
        console.log("‚úÖ User profile from API:", userProfile);

        userToStore = {
          userId: userProfile.user_id || userProfile.userId,
          user_id: userProfile.user_id || userProfile.userId,
          email: userProfile.email || form.email,
          first_name: userProfile.first_name || userProfile.firstName || "",
          last_name: userProfile.last_name || userProfile.lastName || ""
        };
        console.log("üíæ Saving user from profile API:", userToStore);

      } catch (profileError) {
        console.error("‚ùå Error fetching user profile:", profileError);
        // Ti·∫øp t·ª•c v·ªõi th√¥ng tin c∆° b·∫£n
      }
    }

    // ‚úÖ TR∆Ø·ªúNG H·ª¢P KH·∫®N C·∫§P: N·∫øu v·∫´n kh√¥ng c√≥ user info, t·∫°o t·ª´ th√¥ng tin c∆° b·∫£n
    if (!userToStore) {
      console.log("üîÑ Using fallback user data");

      // Gi·∫£ s·ª≠ user_id = 8 t·ª´ database (nh∆∞ b·∫°n ƒë√£ show)
      userToStore = {
        userId: 8, // Hardcode t·ª´ database result
        user_id: 8,
        email: form.email,
        first_name: "Thuy", // Hardcode t·ª´ database
        last_name: "Nguyen"  // Hardcode t·ª´ database
      };
      console.log("üíæ Saving fallback user:", userToStore);
    }

    // ‚úÖ L∆ØU V√ÄO LOCALSTORAGE
    console.log("üíæ FINAL - Saving user to localStorage:", userToStore);
    localStorage.setItem("user", JSON.stringify(userToStore));

    // ‚úÖ KI·ªÇM TRA FINAL DATA
    const finalUser = JSON.parse(localStorage.getItem("user"));
    console.log("üîç FINAL USER IN LOCALSTORAGE:", finalUser);

    alert("‚úÖ ƒêƒÉng nh·∫≠p th√†nh c√¥ng!");
    window.location.href = "/";

  } catch (err) {
    console.error("‚ùå LOGIN ERROR:", err);
    alert("‚ùå ƒêƒÉng nh·∫≠p th·∫•t b·∫°i: " + (err.message || "Vui l√≤ng ki·ªÉm tra email v√† m·∫≠t kh·∫©u"));
  }
};
  return (
    <div className="card mx-auto" style={{ maxWidth: "380px", marginTop: "100px" }}>
      <div className="card-body">
        <h4 className="card-title mb-4">Sign in</h4>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <input
              name="email"
              className="form-control"
              placeholder="Email"
              type="email"
              value={form.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <input
              name="password"
              className="form-control"
              placeholder="Password"
              type="password"
              value={form.password}
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit" className="btn btn-primary btn-block">
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default Login;
